import React from 'react';

Features = () =>{
    return(
        <>
       <div className="single_feature">
            <div className="feature_box">
                 <img src="" alt="" />
                 <h3>Lowest Price</h3>
                 <p>We offer our world class laundry service for as low as $1.33/lb and we're not planning on changing that any time soon.</p>
            </div>
        </div>
        </>
    )
}
    
export default Features;
